[{"location":"pages/etl/etl/#ETL-Pipeline.","page":"Data Pipeline","title":"ETL Pipeline.","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"ETL, standing for Extract, Transform and Load, is the process of combining data from multiple sources into a large central repository of data. What is ETL? (AWS)","category":"page"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"This package should have an ETL capability to retrieve and store financial data ","category":"page"},{"location":"pages/etl/etl/#.-Extract","page":"Data Pipeline","title":"1. Extract","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"Data can extracted from:","category":"page"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"APIs of data providers such as Quandl or Yahoo\nAPIs of brokers such as Alpaca\nLocal files such as CSVs or JSON with a predetermined format","category":"page"},{"location":"pages/etl/etl/#.-Transform","page":"Data Pipeline","title":"2. Transform","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"Once the data is extracted it locally is formatted and cleaned to standarize the format and schema they should comply with.","category":"page"},{"location":"pages/etl/etl/#.-Load","page":"Data Pipeline","title":"3. Load","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"Lastly the data is served into a variable accesible for the package and persisted in an efficient file format.","category":"page"},{"location":"pages/etl/etl/#Supported-schemas-and-file-structure","page":"Data Pipeline","title":"Supported schemas and file structure","text":"","category":"section"},{"location":"pages/etl/etl/#OHLCV","page":"Data Pipeline","title":"OHLCV","text":"","category":"section"},{"location":"pages/etl/etl/#File-structures-on-other-platforms","page":"Data Pipeline","title":"File structures on other platforms","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"Many trading platforms have their own schemas for data","category":"page"},{"location":"pages/etl/etl/#Zorro's","page":"Data Pipeline","title":"Zorro's","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"The zorro project have what they call the T file formats, where a tx file a timestamp \"t\" and x elements. These files are CSV or JSON files stored in ","category":"page"},{"location":"pages/etl/etl/#Headers:","page":"Data Pipeline","title":"Headers:","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"Start - token name or start string of the whole price structure. Determines from where to parse.\nTimeformat - format of the date/time field with DATE format codes, as in the CSV format string.\nTime - token name of the date/time field.\nHigh,Low,Open,Close - token names of the price fields.\nAdjClose - token name of the adjusted close field, or empty if the file contains no such field.\nVolume - toke name of the volume field, or empty if the file contains no volume data.\nAsk - token name of the best ask quote field.\nAskSize - token name of the ask size field.\nBid - token name of the best bid quote field, or empty if the file contains no bid quotes.\nBidSize - token name of the bid size field, or empty.","category":"page"},{"location":"pages/etl/etl/#File-Format:","page":"Data Pipeline","title":"File Format:","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"typedef struct T1\n{\n  DATE  time; // UTC timestamp of the tick in DATE format\n  float fPrice; // price data, positive for ask and negative for bid\n} T1;\n \ntypedef struct T2\n{\n  DATE time;  // UTC timestamp in DATE format\n  float fPrice; // price, negative for bid quotes\n  float fVol; // trade volume or ask/bid size\n} T2; \n \ntypedef struct T6\n{\n  DATE  time; // UTC timestamp of the close, DATE format\n  float fHigh,fLow;\t\n  float fOpen,fClose;\t\n  float fVal,fVol; // additional data, ask-bid spread, volume etc.\n} T6;\n \ntypedef struct CONTRACT\n{\n  DATE  time;   // UTC timestamp in DATE format\n  float fAsk,fBid; // premium without multiplier\n  float fVal,fVol;  // additional data, like delta, open interest, etc.\n  float fUnl;   // underlying price (unadjusted)\n  float fStrike; // strike price\n  long  Expiry; // YYYYMMDD format\n  long  Type;   // PUT, CALL, FUTURE, EUROPEAN, BINARY\n} CONTRACT;","category":"page"},{"location":"pages/etl/etl/#Zipline","page":"Data Pipeline","title":"Zipline","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"Zipline uses what they call OHLCV format, standing for Open, High, Low, Close, Volume. Is a common format to convey daily trade information about a ticker, in addition to the columns in the name actually more columns need to be provided.","category":"page"},{"location":"pages/etl/etl/#File-Format:-2","page":"Data Pipeline","title":"File Format:","text":"","category":"section"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"Zipline actually stores data in a file system. Given a persistency (or cache) directory. It stores the data in bundles stored the following structure $CACHE_PATH/{source_id}/{bundle_id}/ the bundle is then formed in bcolz format","category":"page"},{"location":"pages/etl/etl/","page":"Data Pipeline","title":"Data Pipeline","text":"Zipline OHLCV: Date, Open, High, Low, Close, Volume, Dividend, Split","category":"page"},{"location":"pages/highLevelDesign/#High-Level-Design","page":"Glossary","title":"High Level Design","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"In this section definition for the main objects in this package are presented as well as an introduction to the main logic behind the structure of the package.","category":"page"},{"location":"pages/highLevelDesign/#ETL-Pipeline","page":"Glossary","title":"ETL Pipeline","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"ETL, standing for Extract, Transform and Load, is the process of combining data from multiple sources into a large central repository of data. What is ETL? (AWS)","category":"page"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"This package needs to have an ETL capability to retrieve and store financial data, for reproducibility and post-analytics purposes.","category":"page"},{"location":"pages/highLevelDesign/#Objects","page":"Glossary","title":"Objects","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"In this section we will describe the objects present in the package, some are related to physical and financial entities found in the real world. To ensure our definitions well aligned with the financial we leverage most of the definitions from well established financial entities and/or acadamic sources. In particular IG International Limited: Glossary of Trading Terms is substantially used to support our definitions.","category":"page"},{"location":"pages/highLevelDesign/#Financial-Entitities:","page":"Glossary","title":"Financial Entitities:","text":"","category":"section"},{"location":"pages/highLevelDesign/#Investor","page":"Glossary","title":"Investor","text":"","category":"section"},{"location":"pages/highLevelDesign/#Broker","page":"Glossary","title":"Broker","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited: A broker is an independent person or a company that organises and executes financial transactions on behalf of another party. They can do this across a number of different asset classes, including stocks, forex, real estate and insurance. A broker will normally charge a commission for the order to be executed. Some brokers will provide you with market data and give you advice on the products you want to buy or sell – depending on whether they are a full service broker, or execution only. However, a broker must be licensed to give advice and execute the sale, and they will only perform trades on your behalf once you have given them the go-ahead.","category":"page"},{"location":"pages/highLevelDesign/#Market","page":"Glossary","title":"Market","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited: A financial market is defined as a medium through which assets are traded, enabling buyers and sellers to interact and facilitate exchanges. However, the term can be used in a variety of different ways – it can refer physical places, virtual exchanges or groups of people that are interested in making transactions.","category":"page"},{"location":"pages/highLevelDesign/#Financial-constructs-and-instruments","page":"Glossary","title":"Financial constructs and instruments","text":"","category":"section"},{"location":"pages/highLevelDesign/#Currency","page":"Glossary","title":"Currency","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Investopedia definition  Currency is a medium of exchange for goods and services. In short, it's money, in the form of paper and coins, usually issued by a government and generally accepted at its face value as a method of payment.","category":"page"},{"location":"pages/highLevelDesign/#Asset","page":"Glossary","title":"Asset","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited: An asset is an economic resource which can be owned or controlled to return a profit, or a future benefit. In financial trading, the term asset relates to what is being exchanged on markets, such as stocks, bonds, currencies or commodities.","category":"page"},{"location":"pages/highLevelDesign/#Spread","page":"Glossary","title":"Spread","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited: In finance, the spread is the difference in price between the buy (bid) and sell (offer) prices quoted for an asset.","category":"page"},{"location":"pages/highLevelDesign/#Position","page":"Glossary","title":"Position","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited: A position is the expression of a market commitment, or exposure, held by a trader. It is the financial term for a trade that is either currently able to incur a profit or a loss – known as an open position – or a trade that has recently been cancelled, known as a closed position. Profit or loss on a position can only be realised once it has been closed.","category":"page"},{"location":"pages/highLevelDesign/#Option","page":"Glossary","title":"Option","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited: An option is a financial instrument that offers you the right – but not the obligation – to buy or sell an asset when its price moves beyond a certain price with a set time period.","category":"page"},{"location":"pages/highLevelDesign/#Portfolio","page":"Glossary","title":"Portfolio","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited: A portfolio refers to group of assets that are held by a trader or trading company. Assets in a portfolio can come in many forms, including stocks, bonds, commodities or derivatives.","category":"page"},{"location":"pages/highLevelDesign/#Technical-Objects","page":"Glossary","title":"Technical Objects","text":"","category":"section"},{"location":"pages/highLevelDesign/#Simulations-and-Backtesting","page":"Glossary","title":"Simulations and Backtesting","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"In this section we will describe different calculations and methods used for the backtesting or simulation of a strategy.","category":"page"},{"location":"pages/highLevelDesign/#Portfolio-calculations-/-Financial-reports","page":"Glossary","title":"Portfolio calculations / Financial reports","text":"","category":"section"},{"location":"pages/highLevelDesign/#Returns","page":"Glossary","title":"Returns","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited:  Rate of return (ROR) is the loss or gain of an investment over a certain period, expressed as a percentage of the initial cost of the investment. A positive ROR means the position has made a profit, while a negative ROR means a loss. You will have a rate of return on any investment you make.","category":"page"},{"location":"pages/highLevelDesign/#PnL:-Profit-and-Losses","page":"Glossary","title":"PnL: Profit and Losses","text":"","category":"section"},{"location":"pages/highLevelDesign/","page":"Glossary","title":"Glossary","text":"Definition from IG International Limited:  A profit and loss (P&L) statement is a financial report that provides a summary of a company’s revenue, expenses and profit. It gives investors and other interested parties an insight into how a company is operating and whether it has the ability to generate a profit.","category":"page"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"CurrentModule = AirBorne","category":"page"},{"location":"pages/autodocs/#Automated-Documentation","page":"Autodocs","title":"Automated Documentation","text":"","category":"section"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"Welcome to the documentation for AirBorne!","category":"page"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"This are the autodocs generated by Documenter.jl. ","category":"page"},{"location":"pages/autodocs/#Index","page":"Autodocs","title":"Index","text":"","category":"section"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"","category":"page"},{"location":"pages/autodocs/#Autodocs","page":"Autodocs","title":"Autodocs","text":"","category":"section"},{"location":"pages/autodocs/","page":"Autodocs","title":"Autodocs","text":"Modules = [AirBorne, AirBorne.ETL, AirBorne.ETL.YFinance]","category":"page"},{"location":"pages/autodocs/#AirBorne.hello_world-Tuple{}","page":"Autodocs","title":"AirBorne.hello_world","text":"hello_world()\n\nReturns a string saying \"Hello World!\".\n\n\n\n\n\n","category":"method"},{"location":"pages/autodocs/#AirBorne.ETL","page":"Autodocs","title":"AirBorne.ETL","text":"This modules centralizes all features for the data pipeline of AirBorne including API\nconnections, cache management and data transformations as part of the data pipeline.\n\n\n\n\n\n","category":"module"},{"location":"pages/autodocs/#AirBorne.ETL.YFinance","page":"Autodocs","title":"AirBorne.ETL.YFinance","text":"This modules provides an interface between AirBorne and Yahoo Finance API.\n\n\n\n\n\n","category":"module"},{"location":"pages/autodocs/#AirBorne.ETL.YFinance.get_chart_data-NTuple{4, Any}","page":"Autodocs","title":"AirBorne.ETL.YFinance.get_chart_data","text":"get_chart_data(symbol, period1, period2, freq)\n\nThis function calls the Yahoo chart API to get the OHCLV data. The documentation for this function is based on CryptoCoinTracker's guide.\n\nArguments\n\nsymbol::String:  Ticker Symbol\nperiod1::String:  UNIX Timestap indicating the start of the data requested\nperiod2::String:  UNIX Timestap indicating the end time of the data requested \nfreq::String: The time interval between two data points. Can be 1m 2m 5m 15m 30m 60m 90m 1h 1d 5d 1wk 1mo 3mo.\n\nReturns\n\nr::HTTP.Messages.Response\n\nExamples\n\n# This example is untestable as it requires internet connection.\njulia> import AirBorne\njulia> r = AirBorne.ETL.YFinance.get_chart_data(\"AAPL\",\"1577836800\",\"1580515200\",\"1d\")\n\n\n\n\n\n","category":"method"},{"location":"pages/autodocs/#AirBorne.ETL.YFinance.get_interday_data-Tuple{Any, Any, Any}","page":"Autodocs","title":"AirBorne.ETL.YFinance.get_interday_data","text":"function get_interday_data(symbols, period1, period2)\n\nUse this function to get interday data for different tickers from Yahoo charts API.\n\nArguments\n\nsymbols::String:  Ticker Symbol\nperiod1::String:  UNIX Timestap indicating the start of the data requested\nperiod2::String:  UNIX Timestap indicating the end time of the data requested \n\nExample\n\nimport AirBorne\ndata = AirBorne.ETL.YFinance.get_interday_data([\"AAPL\",\"GOOG\"],\"1577836800\",\"1580515200\")\n\n\n\n\n\n","category":"method"},{"location":"pages/autodocs/#AirBorne.ETL.YFinance.hello_yfinance-Tuple{}","page":"Autodocs","title":"AirBorne.ETL.YFinance.hello_yfinance","text":"hello_yfinance()\n\nReturns a string saying \"Hello YFinance!\".\n\n\n\n\n\n","category":"method"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = AirBorne","category":"page"},{"location":"#AirBorne","page":"Home","title":"AirBorne","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Welcome to the documentation for AirBorne!","category":"page"},{"location":"","page":"Home","title":"Home","text":"In this documentation you will find descriptions for the methods of the package, reasoning and sources for our high-level design and examples showing how this package can be leveraged. ","category":"page"}]
